import React, { useState, useEffect } from 'react';
import api from '@landinghub/api';

const AdminDashboardContent = () => {
    const [users, setUsers] = useState([]);
    const [payments, setPayments] = useState([]);
    const [templates, setTemplates] = useState([]);
    const [reports, setReports] = useState({});
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const usersRes = await api.get('/api/users');
                const paymentsRes = await api.get('/api/payments');
                const templatesRes = await api.get('/api/templates');
                const reportsRes = await api.get('/api/reports/system');
                setUsers(usersRes.data);
                setPayments(paymentsRes.data);
                setTemplates(templatesRes.data);
                setReports(reportsRes.data);
            } catch (err) {
                console.error('Error fetching admin data:', err);
            } finally {
                setLoading(false);
            }
        };
        fetchData();
    }, []);

    if (loading) return <div>Đang tải...</div>;

    return (
        <div className="admin-content">
            <h1>Admin Dashboard</h1>
            <section>
                <h2>Tổng quan Hệ thống</h2>
                <p>Số Nhà môi giới: {reports.total_brokers}</p>
                <p>Số Leads Tổng: {reports.total_leads}</p>
                <p>Doanh thu Tổng: {reports.total_revenue}</p>
            </section>
            <section>
                <h2>Quản lý Tài khoản</h2>
                <table>
                    <thead>
                    <tr>
                        <th>Email</th>
                        <th>Tên</th>
                        <th>Role</th>
                        <th>Subscription</th>
                        <th>Actions</th>
                    </tr>
                    </thead>
                    <tbody>
                    {users.map((user) => (
                        <tr key={user._id}>
                            <td>{user.email}</td>
                            <td>{user.name}</td>
                            <td>{user.role}</td>
                            <td>{user.subscription}</td>
                            <td><button>Edit</button> <button>Delete</button></td>
                        </tr>
                    ))}
                    </tbody>
                </table>
            </section>
            <section>
                <h2>Kiểm tra Thanh toán</h2>
                <table>
                    <thead>
                    <tr>
                        <th>User</th>
                        <th>Amount</th>
                        <th>Status</th>
                    </tr>
                    </thead>
                    <tbody>
                    {payments.map((payment) => (
                        <tr key={payment._id}>
                            <td>{payment.user_email}</td>
                            <td>{payment.amount}</td>
                            <td>{payment.status}</td>
                        </tr>
                    ))}
                    </tbody>
                </table>
            </section>
            <section>
                <h2>Quản lý Mẫu Marketplace</h2>
                <table>
                    <thead>
                    <tr>
                        <th>Title</th>
                        <th>Price</th>
                        <th>Actions</th>
                    </tr>
                    </thead>
                    <tbody>
                    {templates.map((template) => (
                        <tr key={template._id}>
                            <td>{template.title}</td>
                            <td>{template.price}</td>
                            <td><button>Duyệt</button> <button>Xóa</button></td>
                        </tr>
                    ))}
                    </tbody>
                </table>
            </section>
            <section>
                <h2>Báo cáo Hệ thống</h2>
                <p>View Count Tổng: {reports.total_view_count}</p>
                <p>Lead Count Tổng: {reports.total_lead_count}</p>
                <button>Export</button>
            </section>
        </div>
    );
};

export default React.memo(AdminDashboardContent);
